import {
  Container,
  Row,
  Col,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import Head from "next/head";
import SEO from "react-seo-component";
// Layout
import Layout from "../components/Layout";

const MailingList = props => (
  <Layout>
    <SEO
      title={"Mailing List | CXC Spanish Online"}
      pathname={"https://www.cxcspnish/privacy"}
      description={
        "Join our mailing list to get free weekly booklets, study notes and exercises right in your email!"
      }
      siteLanguage={"en"}
      twitterUsername={"_rxheem"}
      author={"Raheem McDonald"}
      article={true}
      publishedDate={"Jan 13, 2020"}
      modifiedDate={"Jan 13, 2020"}
    />

    <Container>
      <Breadcrumb>
        <BreadcrumbItem active>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>Mailing List</BreadcrumbItem>
      </Breadcrumb>
    </Container>

    <Card>
      <CardBody></CardBody>
    </Card>
  </Layout>
);

export default MailingList;
